import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SidebarAdmin from './componentes/SidebarAdmin';
import Dashboard from './paginas/Dashboard';
import Residentes from './paginas/Residentes'; // Importamos la p치gina de Residentes
import './AppAdmin.css';

const AppAdmin = () => {
    const [isCollapsed, setIsCollapsed] = useState(false);

    // Funci칩n para alternar el estado del Sidebar
    const toggleSidebar = () => {
        setIsCollapsed(!isCollapsed);
    };

    return (
        <Router>
            <div className={`app-container ${isCollapsed ? 'collapsed' : ''}`}>
                <SidebarAdmin isCollapsed={isCollapsed} toggleSidebar={toggleSidebar}/>
                <div className="main-content">
                    <Routes>
                        <Route path="/dashboard" element={<Dashboard/>}/>
                        <Route path="/residentes" element={<Residentes/>}/>
                        {/* Otras rutas */}
                    </Routes>
                </div>
            </div>

        </Router>
    );
};

export default AppAdmin;
